import logo from './logo.svg';
import './App.css';

function App() {
const nombre = 'Ricardo'
const x = true

  return (
    <div>
    <h1>hola Mundo desde React</h1>
    <h1>hola Mundo desde React {nombre}</h1>
    <h1>hola Mundo desde React {30 + 25}</h1>
    <h1>hola Mundo desde React {x ? 'YES' : 'NO'}</h1>
    </div>
  );
}

export default App;
